trailingComments.value:
*
 * 打开客户端多tab页面
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @return {Promise.<void>}
 *
 * @example
 *  libSQ.exec('navigation-tab-browser', {
 *     params: {
 *     position: 0,
 *     title: '规则说明',
 *     hoverOnActionBar: false,
 *     tabInfos: [
 *       {
 *         id: '2',
 *         name: '月票',
 *         url: `${domain}/?sq_pg_param=owlmt#!/tab/monthTicket/hash/vote-reward`,
 *       },
 *       {
 *         id: '4',
 *         name: '推荐票',
 *         url: `${domain}/?sq_pg_param=owlmt#!/tab/recommendTicket/`,
 *       },
 *     ],
 *   },
 * }).then((info) => {
 *   console.log(`[navigation-tab-browser][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[navigation-tab-browser][error] ${JSON.stringify(err, null, 2)}`);
 * });

